def pred_acc_vs_representation(predictions: dict, counts: dict):
    cpc_list = []
    for key in predictions.keys():
        correct = predictions[key][0]
        wrong = predictions[key][1]
        accuracy = correct / (correct + wrong)
        try:
            count = counts[key]
        except KeyError:
            count = 0
        dict = {'cpc': key, 'accuracy': accuracy, 'count': count}
        cpc_list.append(dict)

    print(cpc_list)

    with open('acc.csv', 'w', newline='') as outfile:
        writer = csv.DictWriter(outfile, cpc_list[0].keys())
        writer.writeheader()
        writer.writerows(cpc_list)
